function CharacterCard({ character }) {
  const { name, image, status, species, origin, location } = character;

  console.log(character, 'props');

  return (
    <div>
      <ul>
        <p>{character.name}</p>
      </ul>
    </div>
  );
}

export default CharacterCard;
